INSERT INTO `tbl_services` (`id`, `service_name`, `description`, `image`, `created_by`, `created_date`) VALUES
(1, 'Corporate Travel', 'Our corporate travel services are centered around safety, environmental responsibility, and customized travel options.\r\n\r\nWe\'ll help you plan destinations, book accommodations and transportation, create schedules, and ensure that all safety regulations are adhered to. Make your next business trip one to remember with our assistance.', 'CorporateTravel.jpg', 1, '2025-04-08 16:32:23'),
(2, 'Outstation Travel', 'Are you planning to leave Bangalore and travel outside of the city?  With the help of our outstation cab from Bangalore, outstation bus hire, mini bus booking for outstation, you can start your road trip without worrying about car upkeep, gasoline, or directions. All you have to do is concentrate on making memories; the rest is our job.', 'OutstationTravel.jpg', 1, '2025-04-08 16:35:24'),
(3, 'Airport Transportation', 'Convenient Airport Transportation Services in Bangalore\r\nAre you trying to find a dependable airport cab in Bangalore? Anaadi Travels is willing to help. We recognize how difficult and time-consuming it may be to get to and from the airport. We provide a selection of airport transportation options to ensure an easy and faultless travel experience.', 'AirportTransportation.jpg', 1, '2025-04-08 16:41:25');
INSERT INTO `tbl_testimonial` (`id`, `name`, `sub_title`, `testimonial`, `image`, `created_by`, `created_date`) VALUES
(1, 'Sarah Rahman', 'Traveler', 'A worldwide tour involves visiting multiple destinations across the globe, often spanning several countries, continents, and iconic landmark. It can be customized based on personal interest, such as history, culture, nature, adventure, or luxury travel. A world tour may last anywhere from a few weeks to several months or even a year.', '_02.png', 1, '2025-04-09 15:24:38'),
(2, 'Jagadish', 'Traveller', 'Thank you for the memorable holidays you planned for us and our trip was wonderful!!!!!!!.', '_01.png', 1, '2025-04-09 15:27:21'),
(3, 'Prakash', 'Traveller', 'Over all we had good trip and everything went fine, very well organized and it was very professional...', '_00.png', 1, '2025-04-09 15:27:40'),
(4, 'Nandha kumar', 'Businessman', 'Thanks for all your arrangements made and making our trip so memorable one, Once again I thank on behalf of our Business professionals.', '.png', 1, '2025-04-09 15:28:26');
