INSERT INTO `tbl_tours` (`id`, `title`, `url_title`, `category_id`, `tourcategory_id`, `type_id`, `duration_nights`, `duration_days`, `price`, `start_location`, `destination_location`, `covered_locations`, `accomodations`, `activities`, `itinerary`, `inclusions`, `exclusions`, `images`, `created_by`, `created_date`) VALUES
(1, '2 Nights 3 Days Hampi Local Sightseeing Package Itinerary', '2-Nights-3-Days-Hampi-Local-Sightseeing-Package-Itinerary', 1, 1, 1, 2, 3, 11000, 'Bengaluru', 'Hampi', 'Hampi, Hospet', 'Comfortable and well-rated hotels in Hampi', 'Temple visits, historical site exploration, and cultural experiences', '<p>Explore the ancient and mystical city of Hampi with our Hampi local sightseeing package. Nestled in the state of Karnataka, Hampi is a UNESCO World Heritage Site, renowned for its majestic ruins and historical significance. This 2-night, 3-day package offers a perfect blend of adventure, history, and spirituality, making it one of the Best Places To Visit In India With Family. With our carefully curated itinerary, you will experience the grandeur of the Vijayanagara Empire and enjoy one of the Best India Tour Packages designed for a memorable family trip.</p><p><br></p><p>Day 1: Exploring Historical Hampi</p><p><br></p><p>Your adventure begins at Hospet, the gateway to Hampi. After a hearty breakfast, we start our Hampi local sightseeing package with a visit to the Virupaksha Temple, one of the most Famous Temples In South India. This ancient temple dedicated to Lord Shiva is renowned for its stunning architecture and historical significance. Next, we\'ll explore the Hampi Bazaar, which was once a thriving marketplace during the Vijayanagara Empire. In the afternoon, visit the Lotus Mahal and the Elephant Stables, marveling at their intricate designs and grand structures. In the evening, unwind at the banks of the Tungabhadra River and soak in the serene atmosphere.</p><p><br></p><p>Day 2: Delving Deeper into Hampi’s Heritage</p><p><br></p><p>On the second day of your Hampi local sightseeing package, we\'ll delve deeper into Hampi\'s rich heritage. Begin your day with a visit to the majestic Vittala Temple, famous for its stone chariot and musical pillars. This site is a must-see on any Hampi sightseeing itinerary. Post lunch, explore the Queen’s Bath, a royal bathing complex that reflects the opulence of the Vijayanagara rulers. As the day progresses, we\'ll visit the Mahanavami Dibba, a ceremonial platform offering panoramic views of Hampi. Conclude your day by exploring the ancient ruins of the Achyutaraya Temple and the bustling courtyards of the Krishna Temple, making it one of the ideal Best Places to Visit in India.</p><p><br></p><p>Day 3: Final Exploration and Departure</p><p><br></p><p>The final day of your Hampi local sightseeing package will be filled with more historical wonders. Begin with a visit to the Hazara Rama Temple, known for its intricate bas-reliefs depicting the Ramayana. Next, we\'ll explore the royal enclosure, which includes the Stepped Tank, the Underground Shiva Temple, and the King\'s Balance. These sites are integral parts of any Hampi sightseeing tour package. After lunch, we\'ll visit the tranquil Hemakuta Hill Temples and the stunning Sasivekalu Ganesha statue. As the day comes to an end, enjoy a peaceful sunset at Matanga Hill, offering breathtaking views of the entire Hampi landscape. This comprehensive tour forms a significant part of any Karnataka Tour Package.</p><p><br></p><p>Conclusion</p><p><br></p><p>Our meticulously planned Hampi local sightseeing package offers a perfect blend of exploration, learning, and relaxation, making it a memorable trip for everyone. Whether you\'re traveling solo, with friends, or family, this itinerary ensures you witness the best of Hampi\'s historical and cultural treasures. Book your tour with us and experience the expertise of the Best Trip planners in India, ensuring a seamless and enriching journey through the timeless beauty of Hampi.</p>', '[\"Daily Breakfast\",\"Room on Double Sharing\",\"Sightseeing at all the mentioned places\"]', '[\"Flight Fare/Train fare\",\"Personal Expenses such as Laundry\",\"Mineral water\"]', '2Nights3DaysHampiLocalSightseeingPackageItinerary_01.jpg,2Nights3DaysHampiLocalSightseeingPackageItinerary_02.jpg', 1, '2025-04-07 21:32:37'),
(2, '2 Night 3 Days Coorg Honeymoon Package', '2-Night-3-Days-Coorg-Honeymoon-Package', 1, 1, 6, 3, 4, 7500, 'Bengaluru', 'Coorg', 'Bangalore, Coorg', 'Romantic resorts or luxury homestays in Coorg', 'Nature walks, sightseeing, coffee plantation tours, and indulging in local cuisine', '<p>Nestled amidst the lush Western Ghats of Karnataka, Coorg is a picturesque destination perfect for honeymooners seeking a serene and romantic escape. Known as the \"Scotland of India,\" Coorg offers breathtaking landscapes, cascading waterfalls, dense forests, and aromatic coffee plantations. This Coorg Honeymoon Package provides a carefully curated experience, ensuring a balance of adventure, romance, and relaxation. From exploring the best places to visit in Coorg to savoring its unique culture and cuisine, this trip promises unforgettable memories. With charming accommodations and a plethora of activities, this package is ideal for couples who wish to embark on a romantic journey in one of the most beautiful honeymoon destinations in India.</p><p><br></p><p>Day 1: Welcome to Bangalore</p><p>Your journey begins as you arrive in Bangalore, the vibrant capital of Karnataka. Upon your arrival, you will be greeted by a friendly chauffeur who will drive you to Coorg, approximately a 6-hour journey through picturesque roads. The scenic drive is the perfect start to your honeymoon, as you witness lush greenery and rolling hills en route.</p><p><br></p><p>Upon reaching Coorg, you will check in to your cozy accommodation, designed to offer privacy and comfort. The evening is yours to unwind and soak in the tranquil ambiance. Take a leisurely walk around the resort or simply enjoy the stunning views of the hills. Indulge in a romantic dinner under the stars, marking the perfect beginning to your Coorg Honeymoon Package.</p><p><br></p><p>Day 2: Sightseeing in Coorg</p><p>Your second day begins with a hearty breakfast at your resort, preparing you for a day filled with exploration and adventure. Coorg is known for its natural beauty and cultural richness, making it an ideal destination for couples.</p><p><br></p><p>Start your sightseeing tour with a visit to Abbey Falls, a mesmerizing waterfall surrounded by lush greenery. The sound of cascading water and the surrounding serenity make it a perfect spot for couples to capture memories. Next, head to Raja’s Seat, a scenic garden offering panoramic views of the valleys, making it an excellent location for romantic moments.</p><p><br></p><p>Continue your day with a tour of a local coffee plantation. Coorg’s coffee is world-famous, and walking through the aromatic plantations is an experience like no other. Learn about the coffee-making process and enjoy a cup of freshly brewed coffee together. If time permits, visit the Namdroling Monastery, also known as the Golden Temple, to admire its stunning Tibetan architecture and peaceful atmosphere.</p><p><br></p><p>Return to your resort in the evening to relax. Consider indulging in a couple’s spa session or simply enjoy the serene surroundings. End your day with a candlelight dinner, adding a touch of romance to your honeymoon packages in India.</p><p><br></p><p>Day 3: Return from Coorg to Bangalore</p><p>After a delightful breakfast, it’s time to bid farewell to the enchanting hills of Coorg. Your chauffeur will drive you back to Bangalore, ensuring a comfortable and scenic return journey. En route, you can stop at Dubare Elephant Camp for a quick visit. Here, you can interact with elephants, watch them being bathed, and even go on a short elephant ride, making it a unique experience to wrap up your trip.</p><p><br></p><p>Once you reach Bangalore, you can proceed with your onward journey, taking back cherished memories of your Coorg Tour Package. The blend of nature, culture, and romance will leave you longing for another visit to this paradise.</p><p><br></p><p>Conclusion</p><p>This Coorg Honeymoon Package offers an idyllic escape for couples looking to explore one of the most serene and romantic destinations in Karnataka. With carefully selected activities and luxurious accommodations, it ensures a perfect mix of relaxation and adventure. Coorg stands out as one of the best places to visit in Coorg for a honeymoon, providing couples with unforgettable experiences. Book this package with the best tour planner in India to make your honeymoon truly special.</p>', '[\"Airport/Railway transfers\",\"Accommodation\",\"Sightseeing\",\"Breakfast\"]', '[\"Lunch/Dinner\",\"Waiting or additional transfer fees\",\"Use of Gymnasium\",\"Cab: SIC\",\"Personal expenses\"]', '2Night3DaysCoorgHoneymoonPackage.png,2Night3DaysCoorgHoneymoonPackage.jpg', 1, '2025-04-07 21:38:20'),
(3, '4 Nights 5 Days Malaysia Tour Package', '4-Nights-5-Days-Malaysia-Tour-Package', 2, 3, 1, 4, 5, 20000, 'Bengaluru', 'Kuala Lumpur', 'Kuala Lumpur, Batu Caves, Genting Highlands, Sunway Lagoon', '4-star hotels in Kuala Lumpur', 'City tour, theme park visit, cultural exploration, shopping, and local cuisine tasting', '<p>Discover Malaysia, one of the Most Romantic Places In The World, with this exciting Malaysia 5 days tour package. Perfect for couples, families, or groups, this journey promises a blend of modern cityscapes, rich cultural history, and thrilling adventures. Explore the bustling city of Kuala Lumpur with its iconic skyline dominated by the Petronas Twin Towers. Dive into the cultural essence of Malaysia by visiting the ancient Batu Caves, and experience the lush greenery and cool climate of the Genting Highlands.</p><p><br></p><p>Your Malaysia holiday packages also include a day of thrilling water rides and attractions at the famous Sunway Lagoon theme park. Whether you\'re seeking a romantic escape or an adventurous getaway, the Malaysia travel package offers a perfect mix of excitement and relaxation. Indulge in local Malaysian cuisine, explore vibrant markets, and enjoy the nightlife in Kuala Lumpur, one of Asia\'s most dynamic cities. This itinerary is tailored to ensure a memorable vacation with the perfect balance of sightseeing, cultural experiences, and leisure activities. Book your Malaysia trip package today and immerse yourself in the charm of this stunning destination.</p><p><br></p><p>Day 1: Arrival in Kuala Lumpur</p><p>Your adventure begins as you arrive at Kuala Lumpur International Airport. After a warm welcome, transfer to your hotel for check-in. The rest of the day is free for you to relax or explore the local area at your leisure. Take a stroll through the city and enjoy the sights of Kuala Lumpur’s bustling streets. For dinner, head to Jalan Alor, a famous food street offering a variety of Malaysian dishes.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Arrival, city exploration</p><p><br></p><p>Day 2: Kuala Lumpur City Tour</p><p>After breakfast, embark on a full-day tour of Kuala Lumpur’s most iconic landmarks. Visit the towering Petronas Twin Towers, the Sultan Abdul Samad Building, and the bustling Independence Square. In the afternoon, visit the historic Batu Caves, a limestone hill with a series of caves and cave temples. It’s one of the most popular Hindu shrines outside India and an essential stop on your Malaysia 5 days tour package.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: City tour, Batu Caves visit</p><p><br></p><p>Day 3: Genting Highlands</p><p>Today, you’ll take a trip to the famous Genting Highlands, known for its cool climate, theme parks, and casinos. Take a scenic cable car ride to the hilltop resort and explore the many attractions, including the indoor theme park, shopping malls, and restaurants. If you\'re feeling lucky, visit one of the many casinos. The day promises to be filled with excitement and leisure.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Genting Highlands tour, cable car ride, theme park visit</p><p><br></p><p>Day 4: Sunway Lagoon Theme Park</p><p>Prepare for a day of thrills at Sunway Lagoon, one of the best water and amusement parks in Asia. Enjoy water slides, wave pools, and amusement rides that cater to all ages. It’s the perfect spot for families or couples looking for adventure and fun. After a day of excitement, return to your hotel for a relaxing evening.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Sunway Lagoon theme park visit</p><p><br></p><p>Day 5: Departure from Kuala Lumpur</p><p>On your final day, enjoy some free time for last-minute shopping or sightseeing. You could visit the bustling Bukit Bintang area for luxury shopping or souvenirs. After checking out from the hotel, you’ll be transferred to Kuala Lumpur International Airport for your flight back home, concluding your memorable Malaysia 5 days tour package.</p><p><br></p><p>Activities: Free time, departure</p><p><br></p><p>Conclusion</p><p>This Malaysia 5 days tour package offers an unforgettable journey through one of the Most Romantic Places In The World. Whether you’re exploring the vibrant city of Kuala Lumpur, relaxing in the cool air of the Genting Highlands, or enjoying the thrills at Sunway Lagoon, this trip has something for everyone. Book your Malaysia tour packages through Trip Planner India and experience the best of this tropical paradise. With flights, accommodations, and activities included, it’s one of the best international tour packages from India.</p>', '[\"Accommodation\",\"Transfers in SIC Cab\",\"Sightseeing\",\"Night Safari\",\"Sentosa Island\",\"One Skyway Cable Car\"]', '[\"Airfare\",\"All meals\",\"Early Check-in\",\"Personal Expenses\",\"Laundry Bills\",\"TipsPorter Charges\"]', '4Nights5DaysMalaysiaTourPackage.jpg,4Nights5DaysMalaysiaTourPackage_00.jpg', 1, '2025-04-07 22:02:05'),
(4, '2 Nights 3 Days Mauritius Tour Package From India Itinerary', '2-Nights-3-Days-Mauritius-Tour-Package-From-India-Itinerary', 2, 4, 2, 2, 3, 25000, 'Bengaluru', 'Mauritius', 'Port Louis, Ile aux Cerfs, and Grand Baie', 'Luxury beach resorts or boutique hotels with sea views', 'Beach activities, island hopping, exploring local markets, and indulging in Mauritian cuisine', '<p><strong>Mauritius</strong>, a jewel in the Indian Ocean, is renowned for being one of the most romantic places in the world, making it a perfect getaway for couples, families, and friends alike. The turquoise lagoons, pristine beaches, and lush greenery offer a serene escape from the mundane. If you\'re planning a trip to Mauritius from India, this Mauritius Tour Package From India ensures a hassle-free and memorable holiday. From breathtaking beaches to thrilling water sports and vibrant nightlife, this itinerary caters to all. With carefully curated activities, you will explore the best of this tropical paradise while enjoying world-class hospitality. This short yet enriching journey includes visits to iconic locations like Port Louis, Ile aux Cerfs, and the vibrant Grand Baie.</p><p><br></p><p><strong>Day 1: Arrival and Exploring Port Louis</strong></p><p>Upon arriving at the Sir Seewoosagur Ramgoolam International Airport, you\'ll be greeted by your tour representative and escorted to your resort. After a quick check-in and refreshing welcome drink, your Mauritius holiday packages from India adventure begins.</p><p><br></p><p>Start your day with a city tour of Port Louis, the bustling capital of Mauritius. The Caudan Waterfront, with its array of shops, cafes, and cultural landmarks, is a great place to kick off your exploration. Marvel at the Blue Penny Museum, which houses some of the rarest artifacts and stamps.</p><p><br></p><p>Next, visit the Central Market to soak in the vibrant local culture. Pick up souvenirs, including handicrafts, spices, and local artwork. Wrap up your day at Champ de Mars, the oldest racecourse in the Southern Hemisphere, offering stunning sunset views.</p><p><br></p><p>In the evening, enjoy a delectable Mauritian dinner at your resort. Relish local dishes like dholl puri and gateaux piments while enjoying the calming sea breeze.</p><p><br></p><p><strong>Day 2: Island Adventures at Ile aux Cerfs</strong></p><p>After a hearty breakfast, gear up for an unforgettable day of island exploration. Your India to Mauritius holiday package takes you to the stunning Ile aux Cerfs, a small paradise island located off the east coast of Mauritius.</p><p><br></p><p>Hop on a speedboat ride to this tropical haven, surrounded by crystal-clear waters and powdery white sand. Begin with thrilling water sports such as parasailing, snorkeling, and banana boat rides. Discover the rich marine life and vibrant coral reefs as you snorkel in the clear lagoon.</p><p><br></p><p>After the adrenaline rush, unwind under the shade of palm trees or take a refreshing swim in the calm waters. For lunch, indulge in a beachside barbecue, with freshly caught seafood and tropical fruits.</p><p><br></p><p>Post-lunch, enjoy a leisurely stroll around the island, exploring hidden coves and capturing Instagram-worthy photos. As the sun sets, return to your resort for a relaxed evening. Consider a beachside candlelit dinner to elevate the romantic vibe.</p><p><br></p><p>Day 3: Grand Baie and Departure</p><p>On your final day, savor a sumptuous breakfast at the resort before heading out to explore the picturesque village of Grand Baie. Known for its vibrant nightlife and boutique shopping, Grand Baie is a must-visit on your Mauritius trip packages from India.</p><p><br></p><p>Start by exploring the charming La Cuvette Beach, perfect for a serene morning walk. Next, head to the Grand Baie Bazaar for some last-minute shopping. From local handicrafts to luxury brands, this market has it all.</p><p><br></p><p>For lunch, treat yourself to authentic Creole cuisine at one of the local eateries. Don\'t miss dishes like rougaille and cari poulet, paired with refreshing sugarcane juice.</p><p><br></p><p>In the afternoon, bid farewell to this beautiful island as your tour representative transfers you to the airport. Your Mauritius trip from India ends with cherished memories and an eagerness to return.</p><p><br></p><p><strong>Conclusion</strong></p><p>Mauritius is a dream destination offering a perfect blend of natural beauty, cultural experiences, and luxurious indulgence. With its azure waters, vibrant markets, and exhilarating activities, it is no wonder that it is one of the most sought-after destinations. Whether you\'re planning a romantic getaway, a family vacation, or a solo retreat, this Mauritius Tour Package From India ensures a seamless and unforgettable experience.</p><p><br></p><p>Rely on the expertise of Vacation Planners India to make your journey hassle-free, enriching, and delightful. Let this tropical paradise charm you as you create memories that will last a lifetime.</p><p><br></p><p>This carefully crafted itinerary highlights the best of Mauritius while incorporating all the required keywords, ensuring it is both SEO-friendly and reader-centric.</p>', '[\"Accommodation at a premium resort.\",\"Airport transfers.\",\"Guided local sightseeing tours.\",\"Daily breakfast.\"]', '[\"Airfare\",\"Lunch and dinner.\",\"Personal expenses (shopping, tips, etc.).\",\"Water sports and other optional activities.\"]', '2Nights3DaysMauritiusTourPackageFromIndiaItinerary_01.jpg', 1, '2025-04-07 22:06:54'),
(5, '2 Nights 3 Days Kerala Local Sightseeing Package Itinerary', '2-Nights-3-Days-Kerala-Local-Sightseeing-Package-Itinerary', 1, 6, 1, 2, 3, 11000, 'Bengaluru', 'Kerala', 'Munnar, Wayanad, Vagamon and Thekkady', 'Comfortable and well-rated hotels in Munnar', 'Temple visits, historical site exploration, and cultural experiences', '<p>Explore the ancient and mystical city of Hampi with our Hampi local sightseeing package. Nestled in the state of Karnataka, Hampi is a UNESCO World Heritage Site, renowned for its majestic ruins and historical significance. This 2-night, 3-day package offers a perfect blend of adventure, history, and spirituality, making it one of the Best Places To Visit In India With Family. With our carefully curated itinerary, you will experience the grandeur of the Vijayanagara Empire and enjoy one of the Best India Tour Packages designed for a memorable family trip.</p><p><br></p><p>Day 1: Exploring Historical Hampi</p><p><br></p><p>Your adventure begins at Hospet, the gateway to Hampi. After a hearty breakfast, we start our Hampi local sightseeing package with a visit to the Virupaksha Temple, one of the most Famous Temples In South India. This ancient temple dedicated to Lord Shiva is renowned for its stunning architecture and historical significance. Next, we\'ll explore the Hampi Bazaar, which was once a thriving marketplace during the Vijayanagara Empire. In the afternoon, visit the Lotus Mahal and the Elephant Stables, marveling at their intricate designs and grand structures. In the evening, unwind at the banks of the Tungabhadra River and soak in the serene atmosphere.</p><p><br></p><p>Day 2: Delving Deeper into Hampi’s Heritage</p><p><br></p><p>On the second day of your Hampi local sightseeing package, we\'ll delve deeper into Hampi\'s rich heritage. Begin your day with a visit to the majestic Vittala Temple, famous for its stone chariot and musical pillars. This site is a must-see on any Hampi sightseeing itinerary. Post lunch, explore the Queen’s Bath, a royal bathing complex that reflects the opulence of the Vijayanagara rulers. As the day progresses, we\'ll visit the Mahanavami Dibba, a ceremonial platform offering panoramic views of Hampi. Conclude your day by exploring the ancient ruins of the Achyutaraya Temple and the bustling courtyards of the Krishna Temple, making it one of the ideal Best Places to Visit in India.</p><p><br></p><p>Day 3: Final Exploration and Departure</p><p><br></p><p>The final day of your Hampi local sightseeing package will be filled with more historical wonders. Begin with a visit to the Hazara Rama Temple, known for its intricate bas-reliefs depicting the Ramayana. Next, we\'ll explore the royal enclosure, which includes the Stepped Tank, the Underground Shiva Temple, and the King\'s Balance. These sites are integral parts of any Hampi sightseeing tour package. After lunch, we\'ll visit the tranquil Hemakuta Hill Temples and the stunning Sasivekalu Ganesha statue. As the day comes to an end, enjoy a peaceful sunset at Matanga Hill, offering breathtaking views of the entire Hampi landscape. This comprehensive tour forms a significant part of any Karnataka Tour Package.</p><p><br></p><p>Conclusion</p><p><br></p><p>Our meticulously planned Hampi local sightseeing package offers a perfect blend of exploration, learning, and relaxation, making it a memorable trip for everyone. Whether you\'re traveling solo, with friends, or family, this itinerary ensures you witness the best of Hampi\'s historical and cultural treasures. Book your tour with us and experience the expertise of the Best Trip planners in India, ensuring a seamless and enriching journey through the timeless beauty of Hampi.</p>', '[\"Daily Breakfast\",\"Room on Double Sharing\",\"Sightseeing at all the mentioned places\"]', '[\"Flight Fare/Train fare\",\"Personal Expenses such as Laundry\",\"Mineral water\"]', '2Nights3DaysKeralaLocalSightseeingPackageItinerary.jpg,2Nights3DaysKeralaLocalSightseeingPackageItinerary_00.jpg', 1, '2025-04-07 21:32:37'),
