INSERT INTO `tbl_tours` (`id`, `title`, `url_title`, `category_id`, `tourcategory_id`, `type_id`, `duration_nights`, `duration_days`, `price`, `start_location`, `destination_location`, `covered_locations`, `accomodations`, `activities`, `itinerary`, `inclusions`, `exclusions`, `images`, `created_by`, `created_date`) VALUES
(11, '4 Nights 5 Days Thailand Tour Package', '4-Nights-5-Days-Thailand-Tour-Package', 2, 12, 1, 4, 5, 20000, 'Bengaluru', 'Thailand', 'Thailand, Batu Caves, Genting Highlands, Sunway Lagoon', '4-star hotels in Thailand', 'City tour, theme park visit, cultural exploration, shopping, and local cuisine tasting', '<p>Discover Thailand, one of the Most Romantic Places In The World, with this exciting Malaysia 5 days tour package. Perfect for couples, families, or groups, this journey promises a blend of modern cityscapes, rich cultural history, and thrilling adventures. Explore the bustling city of Kuala Lumpur with its iconic skyline dominated by the Petronas Twin Towers. Dive into the cultural essence of Malaysia by visiting the ancient Batu Caves, and experience the lush greenery and cool climate of the Genting Highlands.</p><p><br></p><p>Your Malaysia holiday packages also include a day of thrilling water rides and attractions at the famous Sunway Lagoon theme park. Whether you\'re seeking a romantic escape or an adventurous getaway, the Malaysia travel package offers a perfect mix of excitement and relaxation. Indulge in local Malaysian cuisine, explore vibrant markets, and enjoy the nightlife in Kuala Lumpur, one of Asia\'s most dynamic cities. This itinerary is tailored to ensure a memorable vacation with the perfect balance of sightseeing, cultural experiences, and leisure activities. Book your Malaysia trip package today and immerse yourself in the charm of this stunning destination.</p><p><br></p><p>Day 1: Arrival in Kuala Lumpur</p><p>Your adventure begins as you arrive at Kuala Lumpur International Airport. After a warm welcome, transfer to your hotel for check-in. The rest of the day is free for you to relax or explore the local area at your leisure. Take a stroll through the city and enjoy the sights of Kuala Lumpur’s bustling streets. For dinner, head to Jalan Alor, a famous food street offering a variety of Malaysian dishes.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Arrival, city exploration</p><p><br></p><p>Day 2: Kuala Lumpur City Tour</p><p>After breakfast, embark on a full-day tour of Kuala Lumpur’s most iconic landmarks. Visit the towering Petronas Twin Towers, the Sultan Abdul Samad Building, and the bustling Independence Square. In the afternoon, visit the historic Batu Caves, a limestone hill with a series of caves and cave temples. It’s one of the most popular Hindu shrines outside India and an essential stop on your Malaysia 5 days tour package.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: City tour, Batu Caves visit</p><p><br></p><p>Day 3: Genting Highlands</p><p>Today, you’ll take a trip to the famous Genting Highlands, known for its cool climate, theme parks, and casinos. Take a scenic cable car ride to the hilltop resort and explore the many attractions, including the indoor theme park, shopping malls, and restaurants. If you\'re feeling lucky, visit one of the many casinos. The day promises to be filled with excitement and leisure.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Genting Highlands tour, cable car ride, theme park visit</p><p><br></p><p>Day 4: Sunway Lagoon Theme Park</p><p>Prepare for a day of thrills at Sunway Lagoon, one of the best water and amusement parks in Asia. Enjoy water slides, wave pools, and amusement rides that cater to all ages. It’s the perfect spot for families or couples looking for adventure and fun. After a day of excitement, return to your hotel for a relaxing evening.</p><p><br></p><p>Accommodation: 4-star hotel in Kuala Lumpur</p><p>Activities: Sunway Lagoon theme park visit</p><p><br></p><p>Day 5: Departure from Kuala Lumpur</p><p>On your final day, enjoy some free time for last-minute shopping or sightseeing. You could visit the bustling Bukit Bintang area for luxury shopping or souvenirs. After checking out from the hotel, you’ll be transferred to Kuala Lumpur International Airport for your flight back home, concluding your memorable Malaysia 5 days tour package.</p><p><br></p><p>Activities: Free time, departure</p><p><br></p><p>Conclusion</p><p>This Malaysia 5 days tour package offers an unforgettable journey through one of the Most Romantic Places In The World. Whether you’re exploring the vibrant city of Kuala Lumpur, relaxing in the cool air of the Genting Highlands, or enjoying the thrills at Sunway Lagoon, this trip has something for everyone. Book your Malaysia tour packages through Trip Planner India and experience the best of this tropical paradise. With flights, accommodations, and activities included, it’s one of the best international tour packages from India.</p>', '[\"Accommodation\",\"Transfers in SIC Cab\",\"Sightseeing\",\"Night Safari\",\"Sentosa Island\",\"One Skyway Cable Car\"]', '[\"Airfare\",\"All meals\",\"Early Check-in\",\"Personal Expenses\",\"Laundry Bills\",\"TipsPorter Charges\"]', '4Nights5DaysThailandTourPackage.jpg,4Nights5DaysThailandTourPackage_00.jpg,4Nights5DaysThailandTourPackage_01.jpg', 1, '2025-04-07 22:02:05'),
